import React from "react";

const AddSong = props => {

  	return (
    	<div className="App">
      		<div className="main-wrapper">
      			<div align="center">
                	<input type="text" name="search" id="search" placeholder="Search for a song" />
              	</div>
              	<ul class="list-group" id="result"></ul>
      		</div>
    	</div>
  	);
}

export default AddSong;
